import React, { useState } from 'react';
import ReactDataGrid from 'react-data-grid';
import 'react-data-grid/dist/react-data-grid.css';

// const columns = [
//     { key: "item", name: "Item" },
//     { key: "05.07", name: "05.07" }
// ];

const originalCols = [
    { key: "item", name: "Item" }
]

const rows = [
    { item: "Klose", "05.07": 100 },
    { item: "scales", "05.07": 200 }
];

const Grid = () => {

    let [columns, setColumns] = useState(originalCols);
    let [rows, setRows] = useState([]);

    return (
        <ReactDataGrid
            columns={columns}
            rows={rows}
            rowsCount={2}
            minHeight={150}
        />


    )
}

export default Grid;
